Система $S$ полукольцо, если:
1) $\emptyset\in S$;
2) $A,B\in S\Rightarrow A\cap B\in S$;
3) $A_1\subseteq A$, $A_1,A\in S\Rightarrow A=\bigsqcup_{i=1}^nA_i$ для некоторого $n$.

Пусть $T=\{[a,b)\subseteq[A,B)\}$. Тогда $T$ — полукольцо: 
1) $[A,A)=\emptyset$;
2) пересечение полуинтервалов — либо пусто, либо полуинтервал;
3) разбиение разностного полуинтервала на несколько полуинтервалов.

Система $R$ — кольцо, если:
1) $R\neq\emptyset$;
2) $A,B\in R\Rightarrow A\cap B,\;A\triangle B\in R$.

Если $R$ — кольцо, то:
1) $R$ — полукольцо;
2) $A,B\in R\Rightarrow A\cup B,\;A\setminus B\in R$.
